import ReactDOM from "react-dom/client";
const UserContext = createContext();
const Signup = () => {
  const [user, setUser] = useState([
    {
    email: "text@test.com",
    password: "text123*"
    }
  ]);
  return (
    <UserContext.Provider value={user}>
      <h1>{`Hello ${user}!`}</h1>
      <Component2 user={user} />
    </UserContext.Provider>
  );
}
export default Signup;
